# 对allDict的数据处理函数
def processData(allDict):
    global nowIP, historyIP, isCDN, domain, ports, pangZhan, whois, urlPATH, beiAn, framework, cms, waf, houTai, error
    print(allDict)
    nowIP = allDict['nowIP']
    if nowIP == []:
        nowIP = ['空', '空']
    else:
        nowIP = nowIP[0].split('::')
    historyIP = allDict['historyIP']
    historyIP_list = []
    if historyIP == []:
        historyIP = ['空', '空']
    isCDN = allDict['isCDN']
    if isCDN == []:
        isCDN = [{'ip': '空', 'location': '空', 'exist': '空'}]
    else:
        if len(isCDN) >= 2:
            isCDN += [{'exist': "存在CDN"}]
        else:
            isCDN += [{'exist': "不存在CDN"}]
    domain0 = allDict["domain"]
    if domain0 == []:
        domain = ['空']
    else:
        domain = list(set(domain0))   # 去重
    ports0 = allDict["ports"]
    if ports0 == []:
        ports = ['空']
    else:
        ports = list(set(ports0))
    pangZhan0 = allDict["pangZhan"]
    if pangZhan0 == []:
        pangZhan = ['空']
    else:
        pangZhan = list(set(pangZhan0))
    whois = allDict["whois"]
    if (whois == [[]]) or (whois == []):
        whois = {'空': '空'}
    else:
        whois = whois[0]
    urlPathList = []
    for urlPath in allDict["urlPATH"]:
        if '://' in urlPath:
            url0 = urlPath[urlPath.find(':')+3:]
            urlPathList.append(url0)
        else:
            urlPathList.append(urlPath)
    urlPATH = list(set(urlPathList))
    if urlPATH == []:
        urlPATH = ['空']
    beiAn = allDict["beiAn"]
    if beiAn == []:
        beiAn = ['空:空', '空:空']
    framework = allDict["framework"]
    if framework[0] == []:
        framework[0] = ['空', '空']
    cms = framework[1]
    if cms == {}:
        cms = {'空': '空'}
    waf = framework[2]
    if waf == {}:
        waf = {'waf': '没有侦测到waf'}
    houTai_list = ['admin', 'login', 'pass', 'user', 'member', 'system', 'manage', 'service', 'main']
    houTai = []
    for d in urlPATH:
        for k in houTai_list:
            if k in d:
                houTai.append(d)
    for t in houTai:
        try:
            urlPATH.remove(t)
        except Exception as e:
            continue
    error = allDict['error']


